      kg = KeyGenerator(
        seed = b'TESTSEED9DONTUSEINPRODUCTION99999ZTRFNBTRBSDIHWKOWCFBOQYQTENWL',
      )

      # no warning must be raised, since seed has a valid length
      self.assertEqual(len(catched_warnings), 0)

